import React from 'react';
import "./Info.scss";

const Info = () => {
    return (
        <main className='Info'>
            <section className='Info__my--info'>
                <div><b>Front-end Developer</b></div>
                <div><b>Email. </b>gothddlek@naver.com</div>
                <div><b>Birth. </b>2001.06.30</div>
                <div><b>Residence. </b>South Korea</div>
                <div><b>Bachelor Degree. </b>Kumoh Institute of Technology. Electronic IT convergence (2020.03 - 2024.02)</div>
            </section>
        </main>
    );
};

export default Info;
